using System;
using System.Collections.Generic;
using System.Text;
using System.Linq;
using System.Text.RegularExpressions;

namespace AOC2018
{
    public class Day5
    {

        public static void Main()
        {
            var input = @"";
            Console.WriteLine(input.Length);
            int count = Compact(input, "..");
            Console.WriteLine(count);
            Console.WriteLine(Enumerable.Range(0, 26).Select(i => Compact(input, new string(new[] { (char)('a' + i), (char)('A' + i) }))).Min());
        }

        private static int Compact(string input, string exception)
        {
            var s = new Stack<char>();
            int react = Math.Abs('a' - 'A');
            foreach (var c in input)
            {
                if (exception.Contains(c)) continue;
                if (s.Count == 0)
                {
                    s.Push(c);
                    continue;
                }
                if (Math.Abs(s.Peek() - c) == react)
                    s.Pop();
                else
                    s.Push(c);
            }
            var count = s.Count;
            return count;
        }
    }
}
